import React from "react";
import * as List from "./temp";

function App() {
  return (
    <>
      <h1>Addition: {List.default(4, 9)}</h1>
      <h1>Subtraction: {List.sub(4, 5)}</h1>
      <h1>Multiplication: {List.mul(4, 5)}</h1>
      <h1>Division: {List.div(4, 5)}</h1>
    </>
  );
}

export default App;
